use cs3380;

drop table if exists employee;
drop table if exists department;
drop table if exists dailySalary;
drop table if exists monthlySalary;
drop table if exists transportation;
drop table if exists university;
drop table if exists experience;
drop table if exists managerRating;
drop table if exists performance;
drop table if exists jobRating;


create table department
(
    departmentID integer primary key,
    departmentName varchar(100) not null
);

create table monthlySalary
(
    dailyRate integer primary key,
    monthlyRate integer not null
);

create table dailySalary
(
    hourlyRate integer primary key,
    dailyRate integer references monthlySalary(dailyRate)
);


create table transportation
(
    vehicleID integer not null,
    vehicle varchar(100) not null,
    distanceFromHome integer not null,
    commuteHours real not null,
    primary key(vehicleID, distanceFromHome)
);

create table university
(
    universityID integer primary key,
    universityName varchar(100) not null
);

create table experience
(
    totalWorkingYears integer primary key,
    seniority varchar(100) not null
);



create table jobRating
(
    jobInvolvement integer primary key,
    jobSatisfaction integer not null unique
);

create table performance
(
    jobSatisfaction integer references jobRating(jobSatisfaction) primary key,
    performanceRating integer not null unique
);

create table managerRating
(
    performanceRating integer references performance(performanceRating) primary key,
    managerSatisfaction integer not null
);

create table employee
(
    employeeID integer primary key,
    departmentID integer references department(departmentID),
    hourlyRate integer references dailySalary(hourlyRate),
    vehicle integer not null,
    distanceFromHome integer not null,
    universityID integer references university(universityID),
    totalWorkingYears integer references experience(totalWorkingYears),
    jobInvolvement integer references jobRating(jobInvolvement),
    age integer not null,
    businessTravel varchar(100) not null,
    educationYear integer not null,
    educationField varchar(100) not null,
    gender varchar(100) not null,
    maritalStatus varchar(100) not null,
    numCompaniesWorked integer not null,
    overTime varchar(100) not null,
    jobRole varchar(100) not null,
    constraint fk_transportation foreign key (vehicle, distanceFromHome)
    references transportation(vehicleID, distanceFromHome)
);

